export default function Home() {

    const navigateTo = (route) => {
        console.log('navigate to');
        navigate(route);
    }

    return (
        <>
            <div>
                Home
                <button  onClick={() => navigateTo("/partie")} >Commencer une partie</button>
                <button>Carte Quizz</button>
                <button>Galerie</button>
            </div>
        </>
    )
}
